/* 35845 rows of data, of which 5084 zero entries for an interval of 300 seconds,
 * and 0.0.0.0/0 as IP-filter. */
unsigned memory__testdata[215070];


void memory_help() {
    printf(
	"/********************* module: memory (test_live) *****************************/\n"
	"This memory module does not store any acquired data, but provides a pregenerated\n"
	"set of data, fetched at a random time of day.\n"
	"The test set should be reasonably adequate for testing purposes of the storage\n"
	"module. It does not try to reach any limits. The test set is %ld rows long.\n"
	"\n",
	(unsigned long)sizeof(memory__testdata) / sizeof(unsigned) / 6
    );
}

void *memory_alloc() {
    static void *irrelevant = 0;
    return ++irrelevant;
}

void memory_reset(void *memory) {
}

void memory_free(void *memory) {
}

void memory_add(void *memory, uint32_t src, uint32_t dst, uint16_t vlan, uint16_t len) {
}

void memory_enum(void *memory, memory_enum_cb cb) {
    unsigned i;
    for (i = 0; i < sizeof(memory__testdata) / sizeof(unsigned); i += 6) {
	struct ipcount_t data;
	data.vlan = memory__testdata[i];
	data.packets_in = memory__testdata[i+2];
	data.u.bytes_in = memory__testdata[i+3];
	data.packets_out = memory__testdata[i+4];
	data.bytes_out = memory__testdata[i+5];

	cb(memory__testdata[i+1], &data);
    }
}

